import { useEffect, useState } from 'react'
import axios from 'axios'
import '../style/Card.css'

type Product = {
  id: string
  name: string
  color: string
  price: number
  stock: number
}

type CardProps = {
  itemTitle: string
}

export const Card = ({itemTitle}: CardProps) => {
  const [product, setProduct] = useState<Product>({id: '', name: '', color: '', price: -1, stock: -1})
  useEffect(() => {
    axios.get(`/products/${itemTitle}`)
  .then((res) => {
    console.log(res)
    setProduct(res.data)
  })
  .catch(function (error) {
    // TODO: Need to catch it
    console.log(error);
  })
  }, [])

  return (
    <>

      <div className='card-container'>
        <div className="header">
          <div className="fruit-color">{product.id}</div>
          <div className="cancel-fruit"></div>
        </div>
        <div className="quantity"></div>
        <div className="price"></div>
      </div>
    </>
  );
}
